er":[],"videoCategory":{"type":"id","generated":true,"id":"$CategoryData24.widget.videoCategory","typename":"CategoryVideo"},"brandCategory":[],"catalogCategory":[],"longDescription":[{"type":"id","generated":true,"id":"$CategoryData24.widget.longDescription.0","typename":"CategoryLongDesc"},{"type":"id","generated":true,"id":"$CategoryData24.widget.longDescription.1","typename":"CategoryLongDesc"},{"type":"id","generated":true,"id":"$CategoryData24.widget.longDescription.2","typename":"CategoryLongDesc"},{"type":"id","generated":true,"id":"$CategoryData24.widget.longDescription.3","typename":"CategoryLongDesc"}],"__typename":"CategoryWidget"},"$CategoryData24.widget.staticHeader":{"headerImage":"https:\u002F\u002Fecs7.tokopedia.net\u002Fimg\u002Fcache\u002F720x150\u002Fattachment\u002F2019\u002F3\u002F8\u002F24\u002F24_5e07db14-4596-4ee3-9e9a-4c205ceccf38.png","headerImageHexColor":"#ffffff","__typename":"StaticHeader"},"$CategoryData24.widget.curatedProduct":{"departmentId":0,"section":[],"__typename":"CuratedProduct"},"$CategoryData24.widget.videoCategory":{"title":"","description":"","videoUrl":"","youtubeId":"","__typename":"CategoryVideo"},"$CategoryData24.widget.longDescription.0":{"title":"Ragam Pilihan Handphone Keluaran Terbaru di Tahun 2020","description":"Di tahun 2020 ini, sudah saatnya untuk mengganti handphone lama Anda dengan handphone keluaran terbaru dari \u003Ca href=\"https:\u002F\u002Fwww.tokopedia.com\u002Fp\u002Fhandphone-tablet\u002Fhandphone\u002Fandroid-os\"\u003Ehp android\u003C\u002Fa\u003E, \u003Ca href=\"https:\u002F\u002Fwww.tokopedia.com\u002Fp\u002Fhandphone-tablet\u002Fhandphone\u002Fwindows-mobile\"\u003Ewindows phone\u003C\u002Fa\u003E atau \u003Ca href=\"https:\u002F\u002Fwww.tokopedia.com\u002Fp\u002Fhandphone-tablet\u002Fhandphone\u002Fios\"\u003Eapple iphone\u003C\u002Fa\u003E. Untuk menemukan pilihan seri terbarunya, Anda dapat melihatnya dengan mengunjungi situs jual beli online Tokopedia. Ketika mengunjungi laman situs Tokopedia dan melakukan pencarian produk handphone, Anda akan disuguhkan dengan ragam pilihan terlengkap dari seller terpercaya yang ada di Tokopedia. Beberapa contoh handphone seperti \u003Ca href=\"https:\u002F\u002Fwww.tokopedia.com\u002Ffind\u002Fsamsung-j3-2016\"\u003Esamsung j3\u003C\u002Fa\u003E, \u003Ca href=\"https:\u002F\u002Fwww.tokopedia.com\u002Ffind\u002Fsamsung-a6-2018\"\u003Esamsung j6\u003C\u002Fa\u003E, dan \u003Ca href=\"https:\u002F\u002Fwww.tokopedia.com\u002Ffind\u002Fhp-asus\"\u003Ehp asus\u003C\u002Fa\u003E tersedia dengan lengkap di Tokopedia baik dalam kondisi baru maupun second. Tak perlu khawatir beli handphone online di Tokopedia, karena seller yang terdaftar telah terverifikasi sehingga Anda tidak perlu takut akan terjadinya penipuan. Selain itu, seller Tokopedia akan mengemas handphone pesanan Anda dengan sangat aman dan terjaga sehingga produk sampai ke tangan Anda dalam kondisi yang baik dan aman. Proses pembelian yang terpercaya, mudah dan praktis hanya bisa Anda dapatkan melalui situs belanja online Tokopedia. Temukan harga produk handphone terbaru dari berbagai brand di tahun 2020 melalui Tokopedia.\r\n\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E","__typename":"CategoryLongDesc"},"$CategoryData24.widget.longDescription.1":{"title":"Tak Lengkap Tanpa Aksesoris Handphone Tambahan dari Tokopedia","description":"\u003Cp\u003EKetika membeli sebuah handphone, ada baiknya jika Anda mengenali terlebih dahulu spesifikasi serta \u003Ca href=\"https:\u002F\u002Fwww.tokopedia.com\u002Fp\u002Fhandphone-tablet\u002Fkomponen-handphone\"\u003Ekomponen handphone\u003C\u002Fa\u003E yang ditawarkan. Karena harganya yang tidak selalu tergolong murah, penting untuk mengetahui apakah handphone tersebut sesuai dengan kebutuhan Anda atau memiliki daya tahan banting yang baik. Dan apabila budget yang dimiliki belum terpenuhi, tak ada salahnya juga jika Anda ingin membeli handphone second. Seperti contoh, Anda ingin memiliki \u003Ca href=\"https:\u002F\u002Fwww.tokopedia.com\u002Fp\u002Fhandphone-tablet\u002Fhandphone\u002Fblackberry-os\"\u003Ehp blackberry\u003C\u002Fa\u003E atau handphone \u003Ca href=\"https:\u002F\u002Fwww.tokopedia.com\u002Ffind\u002Foppo-a3s-second\"\u003Eoppo A3S second\u003C\u002Fa\u003E karena Anda tertarik dengan deskripsi produk serta fitur yang ditawarkan dari brand handphone asal Tiongkok ini. Maka hal yang perlu diketahui adalah berapa lama produk tersebut telah digunakan, apa saja kekurangan yang terdapat selama digunakan oleh pemakai sebelumnya, dan apakah handphone tersebut pernah rusak atau tidak. Dengan demikian Anda jadi tidak terjebak apalagi merasa dikelabui jika sewaktu-waktu handphone second yang Anda beli rusak. Untuk menyiasati handphone second yang Anda beli agar tampak seperti baru, Anda bisa membeli aksesoris tambahan seperti case handphone atau hiasan lainnya yang dapat membuat handphone tampak lebih menarik. Hal tersebut juga berlaku jika Anda ingin memberi sebuah ponsel baru. Selain case, Anda bisa membeli \u003Ca href=\"https:\u002F\u002Fwww.tokopedia.com\u002Ffind\u002Fpower-bank-20000-mah\"\u003Epower bank 20000 mAh\u003C\u002Fa\u003E yang dapat membantu Anda mengisi ulang daya baterai handphone jika sewaktu-waktu habis di perjalanan.\r\n\u003C\u002Fp\u003E","__typename":"CategoryLongDesc"},"$CategoryData24.widget.longDescription.2":{"title":"Perbedaan antara Feature Phone dengan Smartphone","description":"\u003Cp\u003ESebelum adanya sebutan smartphone atau gawai pintar, telepon genggam biasa dikenal dengan sebutan lain yaitu feature phone. Memiliki fungsi yang hampir sama, yaitu sebagai alat komunikasi yang dapat mengirimkan pesan dan mengirim pesan suara, smartphone dan \u003Ca href=\"https:\u002F\u002Fwww.tokopedia.com\u002Fp\u002Fhandphone-tablet\u002Fhandphone\u002Ffeature-phone\"\u003Efeature phone\u003C\u002Fa\u003E juga sama-sama hadir untuk memberikan kemudahan bagi banyak orang. Hanya saja, feature phone belum secanggih gawai pintar nan canggih yang menjamur di pasar elektronik dunia seperti sekarang. Lantas apa saja perbedaannya? Feature phone merupakan sebuah produk transisi dari handphone biasa menuju smartphone. Di dalamnya terdapat satu atau dua fitur yang menjadi andalan dalam telepon genggam tersebut. Seperti misal, ada sebuah feature phone yang hadir dengan fitur kamera yang cukup ciamik untuk mengabadikan gambar yang ada di sekitar. Atau ada pula feature phone yang dibekali dengan kualitas speaker dan music player yang canggih sehingga penggunanya dapat menikmati pemakaian handphone sembari mendengarkan musik favorit. Feature phone ini banyak terdapat pilihannya pada brand handphone Nokia. Brand yang sempat jaya di kisaran tahun '90 hingga 2000-an ini sangat digandrungi dan pernah menghadirkan banyak pilihan feature phone yang menarik dan keren pada zamannya. Karena inovasi yang terus bermunculan, kini kebanyakan orang lebih memilih memakai smartphone yang tentunya lebih canggih dan menawarkan fitur yang lebih menarik.\r\n\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E","__typename":"CategoryLongDesc"},"$CategoryData24.widget.longDescription.3":{"title":"Pentingnya Memiliki Sebuah Handphone di Era Digital","description":"Jika pada zaman dahulu untuk dapat menyampaikan isi hati ataupun isi pesan haruslah dengan bertukar surat dan menunggu berbulan-bulan lamanya untuk bisa sampai, berkat adanya inovasi teknologi berupa perangkat handphone, kini setiap orang dapat mengirimkan isi pesannya kepada lawan bicaranya yang berada di belahan bumi lain. Kemudahan yang ditawarkan oleh sebuah handphone tidaklah hanya berupa sebagai sebuah perangkat untuk bertukar pesan, namun kini telah menjadi sebuah perangkat yang dapat membantu pekerjaan maupun kegiatan sehari-hari. Di era yang segalanya serba bergerak secara dinamis dan cepat, terdapat sebuah kebutuhan pemenuhan informasi yang cepat dan sifatnya tidak delayed. Dengan adanya kebutuhan tersebut, handphone tidak lagi dilihat sebagai sebuah barang mewah melainkan telah dilihat sebagai sebuah kebutuhan. Mulai dari anak remaja hingga orang tua butuh memiliki sebuah handphone, hanya saja pemilihan jenisnya yang harus disesuaikan untuk keperluan pemakaian. Bagi anak remaja, ada baiknya jika penggunaan handphone masih diawasi agar ia tidak menghabiskan terlalu banyak waktu bermain handphone apalagi sampai menyalahgunakan fungsi dari handphone itu sendiri. Dan untuk orang dewasa, handphone yang dipilih bisa disesuaikan dengan kebutuhan pekerjaan ataupun pemenuhan kebutuhan pemakaiannya.\r\n\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E","__typename":"CategoryLongDesc"},"RelatedCategory3054":{"id":3054,"url":"https:\u002F\u002Fm.tokopedia.com\u002Fp\u002Fhandphone-tablet\u002Fhandphone\u002Fandroid-os","name":"Android OS","__typename":"RelatedCategory"},"RelatedCategory3055":{"id":3055,"url":"https:\u002F\u002Fm.tokopedia.com\u002Fp\u002Fhandphone-tablet\u002Fhandphone\u002Fios","name":"iOS","__typename":"RelatedCategory"},"RelatedCategory3058":{"id":3058,"url":"https:\u002F\u002Fm.tokopedia.com\u002Fp\u002Fhandphone-tablet\u002Fhandphone\u002Ffeature-phone","name":"Feature Phone","__typename":"RelatedCategory"},"RelatedCategory3057":{"id":3057,"url":"https:\u002F\u002Fm.tokopedia.com\u002Fp\u002Fhandphone-tablet\u002Fhandphone\u002Fblackberry-os","name":"BlackBerry OS","__typename":"RelatedCategory"},"RelatedCategory3056":{"id":3056,"url":"https:\u002F\u002Fm.tokopedia.com\u002Fp\u002Fhandphone-tablet\u002Fhandphone\u002Fwindows-mobile","name":"Windows Mobile","__typename":"RelatedCategory"},"RelatedCategory66":{"id":66,"url":"https:\u002F\u002Fm.tokopedia.com\u002Fp\u002Fhandphone-tablet\u002Faksesoris-handphone","name":"Aksesoris Handphone","__typename":"RelatedCategory"},"RelatedCategory24":{"id":24,"url":"https:\u002F\u002Fm.tokopedia.com\u002Fp\u002Fhandphone-tablet\u002Fhandphone","name":"Handphone","__typename":"RelatedCategory"},"RelatedCategory3089":{"id":3089,"url":"https:\u002F\u002Fm.tokopedia.com\u002Fp\u002Fh